    false,nt"url": null,nt"notes": "Data from Coral Reef Ecosystem Division
    (CRED), NOAA Pacific Islands Fisheries Science Center (PIFSC) conductivity and temperature
    recorders provide a time series of conductivity and water temperature at coral reef
    sites. Data is typically collected at 1800 second intervals using a MicroCAT Model
    SBE37 (Seabird Electronics, Inc., www.seabird.com). Time series data combining multiple
    deployments from a given site may also be available. Please contact CRED with any
    questions. For program information see the web site https://www.pifsc.noaa.gov/cred/ocean_and_climate_change.php",nt"owner_org":
